pragma solidity ^0.7.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

// Contract inspired by Chubbies (https://chubbies.io/)
contract MeebitAvatars is ERC721, Ownable {
    using SafeMath for uint256;
    uint256 public constant MAX_AVATARS = 6196;

    constructor() ERC721("MeebitAvatars", "MEEBITAVATARS") {
        setBaseURI(
            "https://gateway.pinata.cloud/ipfs/QmNciSjKGXg5jujfA7knpY7B52jXE3ayMkw1tfVkA3aWrW/"
        );
    }

    function tokensOfOwner(address _owner)
        external
        view
        returns (uint256[] memory)
    {
        uint256 tokenCount = balanceOf(_owner);
        if (tokenCount == 0) {
            // Return an empty array
            return new uint256[](0);
        } else {
            uint256[] memory result = new uint256[](tokenCount);
            uint256 index;
            for (index = 0; index < tokenCount; index++) {
                result[index] = tokenOfOwnerByIndex(_owner, index);
            }
            return result;
        }
    }

    function calculatePriceSingleToken(uint256 currentSupply)
        public
        pure
        returns (uint256)
    {
        if (currentSupply >= 6100) {
            return 2400000000000000000; // 6100-6196:  2.4 ETH
        } else if (currentSupply >= 6000) {
            return 1200000000000000000; // 6000-6099:  1.2 ETH
        } else if (currentSupply >= 5500) {
            return 600000000000000000; // 5500-5999:  0.6 ETH
        } else if (currentSupply >= 5000) {
            return 550000000000000000; // 5000-5499:  0.55 ETH
        } else if (currentSupply >= 4500) {
            return 500000000000000000; // 4500-4999:  0.5 ETH
        } else if (currentSupply >= 4000) {
            return 450000000000000000; // 4000-4499:  0.45 ETH
        } else if (currentSupply >= 3500) {
            return 400000000000000000; // 3500-3999:  0.4 ETH
        } else if (currentSupply >= 3000) {
            return 350000000000000000; // 3000-3499:  0.35 ETH
        } else if (currentSupply >= 2500) {
            return 300000000000000000; // 2500-2999:  0.3 ETH
        } else if (currentSupply >= 2000) {
            return 250000000000000000; // 2000-2499:  0.25 ETH
        } else if (currentSupply >= 1500) {
            return 200000000000000000; // 1500-1999:  0.2 ETH
        } else if (currentSupply >= 1000) {
            return 150000000000000000; // 1000-1499:  0.15 ETH
        } else if (currentSupply >= 500) {
            return 100000000000000000; // 500-999:    0.1 ETH
        } else {
            return 50000000000000000; // 0-499:       0.05 ETH
        }
    }

    function calculatePrice(uint256 numAvatars) public view returns (uint256) {
        uint256 currentSupply = totalSupply();
        uint256 totalPrice = calculatePriceSingleToken(currentSupply);
        uint256 modLimit = 500;
        uint256 remainingAvatarsUnderThisPrice =
            modLimit.sub(currentSupply.mod(modLimit));
        if (remainingAvatarsUnderThisPrice >= numAvatars) {
            return totalPrice.mul(numAvatars);
        } else {
            totalPrice = totalPrice.mul(remainingAvatarsUnderThisPrice);
            numAvatars = numAvatars.sub(remainingAvatarsUnderThisPrice);
            uint256 currentPrice =
                calculatePriceSingleToken(
                    currentSupply.add(remainingAvatarsUnderThisPrice).add(1)
                );
            totalPrice = totalPrice.add(currentPrice.mul(numAvatars));
            return totalPrice;
        }
    }

    function createAvatar(uint256 numAvatars) public payable {
        require(totalSupply() < MAX_AVATARS, "Sale has already ended");
        require(
            numAvatars > 0 && numAvatars <= 50,
            "You can create minimum 1, maximum 50 Avatars"
        );
        require(
            totalSupply().add(numAvatars) <= MAX_AVATARS,
            "Exceeds MAX_AVATARS"
        );
        require(
            msg.value >= calculatePrice(numAvatars),
            "Ether value sent is below the price"
        );

        for (uint256 i = 0; i < numAvatars; i++) {
            uint256 mintIndex = totalSupply();
            _safeMint(msg.sender, mintIndex);
        }
    }

    // Owner Mode
    function setBaseURI(string memory baseURI) public onlyOwner {
        _setBaseURI(baseURI);
    }

    function withdrawAll() public payable onlyOwner {
        require(payable(msg.sender).send(address(this).balance));
    }
}
